import React from "react";

const About = () => {
  return (
    <div style={{ padding: "20px" }}>
      <h2>About Virtual Herbal Garden</h2>
      <p>
        This project is an interactive virtual garden showcasing medicinal
        plants categorized under Ayurveda, Yoga & Naturopathy, Unani, Siddha,
        and Homeopathy.
      </p>
    </div>
  );
};

export default About;
